import React, { useState } from 'react';
import SquareButtonAge from './SquareButton';
import * as enumerations from '../constants/enumerations';

export default function ProductStandouts() {
  const [ageRange, setAgeRange] = useState();

  return (
    <React.Fragment>
      <h2>About you</h2>
      <h3>Age Range</h3>
      <h4>
        Choose <span className="bold">One</span>
      </h4>
      <div className="square-buttons-container">
        <SquareButtonAge
          value={enumerations.ageRange.first}
          selectedAge={ageRange}
        />
        <SquareButtonAge value={enumerations.ageRange.second} />
        <SquareButtonAge value={enumerations.ageRange.third} />
        <SquareButtonAge value={enumerations.ageRange.fourth} />
        <SquareButtonAge value={enumerations.ageRange.fifth} />
        <SquareButtonAge value={enumerations.ageRange.sixth} />
        <SquareButtonAge value={enumerations.ageRange.seventh} />
      </div>
    </React.Fragment>
  );
}
